// App.js
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { BrowserRouter as Router, Route, NavLink, Routes } from 'react-router-dom'; // Import 'NavLink' instead of 'Link'
import Home from './Home';
import CountryChart from './CountryDataSearch';
import CountryDataComparison from './CountryComparison';
import './styles.css'; // Import the CSS file
import FileUpload from './file_upload';

function App() {
  return (
    <div className="App">
      <Router>
        <nav>
          <ul>
            <li>
              <NavLink exact to="/" activeClassName="active">Home</NavLink>
            </li>
            <li>
              <NavLink to="/CountryChart" activeClassName="active">Country Population</NavLink>
            </li>
            <li>
              <NavLink to="/CountryComparison" activeClassName="active">Country Comparison</NavLink>
            </li>
            <li>
              <NavLink to="/FileUpload" activeClassName="active">Upload Your Data</NavLink>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/FileUpload" element={<FileUpload />} />
          <Route path="/CountryComparison" element={<CountryDataComparison />} />
          <Route path="/CountryChart" element={<CountryChart />} />
          <Route path="/" element={<Home />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
